import React from "react";
import Button from "@mui/material/Button";
import jobImage from "../images/we-are-hiring-concept-collage.jpg";

const JobList = () => {
  // Example job data
  const jobs = [
    {
      id: 1,
      title: "Software Engineer",
      company: "Tech Corp",
      region: "Remote",
      type: "Full Time",
    },
    {
      id: 2,
      title: "Product Manager",
      company: "Innovate Inc",
      region: "Bulawayo",
      type: "Full Time",
    },
    {
      id: 3,
      title: "Data Analyst",
      company: "Data Works",
      region: "Harare",
      type: "Part Time",
    },
    {
      id: 4,
      title: "UX Designer",
      company: "Design Co",
      region: "Remote",
      type: "Full Time",
    },
    {
      id: 5,
      title: "DevOps Engineer",
      company: "Cloud Solutions",
      region: "Harare",
      type: "Full Time",
    },
    {
      id: 6,
      title: "Marketing Specialist",
      company: "Market Masters",
      region: "Bulawayo",
      type: "Part Time",
    },
    {
      id: 7,
      title: "Sales Executive",
      company: "Sales Pro",
      region: "Remote",
      type: "Full Time",
    },
    {
      id: 8,
      title: "Customer Support",
      company: "Supportive",
      region: "Harare",
      type: "Part Time",
    },
    {
      id: 9,
      title: "Project Manager",
      company: "Manage It",
      region: "Bulawayo",
      type: "Full Time",
    },
  ];

  // Split jobs into top and bottom rows
  const topJobs = jobs.slice(0, 4);
  const bottomJobs = jobs.slice(4, 9);

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        alignItems: "flex-start",
        justifyContent: "space-between",
        flexWrap: "wrap", // Allow wrapping for smaller screens
        padding: "20px",
      }}
    >
      <div style={{ flex: 1, minWidth: "300px", marginRight: "30px" }}>
        <h2 style={{ textAlign: "left", color: "#205781" }}>RECENT JOBS</h2>
        <div style={styles.jobList}>
          {/* Top row with 4 jobs */}
          <div style={styles.jobRow}>
            {topJobs.map((job) => (
              <div key={job.id} style={styles.jobItem}>
                <h3 style={{ color: "#4F959D" }}>{job.title}</h3>
                <p>{job.company}</p>
                <p>
                  {job.region} - {job.type}
                </p>
              </div>
            ))}
          </div>

          {/* Bottom row with 5 jobs */}
          <div style={styles.jobRow}>
            {bottomJobs.map((job) => (
              <div key={job.id} style={styles.jobItem}>
                <h3 style={{ color: "#4F959D" }}>{job.title}</h3>
                <p>{job.company}</p>
                <p>
                  {job.region} - {job.type}
                </p>
              </div>
            ))}
          </div>

          <div>
            <Button
              variant="contained"
              style={{ padding: "10px", backgroundColor: "#205781" }}
            >
              Get More Jobs
            </Button>
          </div>
        </div>
      </div>
      <div
        style={{
          flex: 1,
          minWidth: "300px",
          textAlign: "center",
        }}
      >
        <img
          src={jobImage}
          alt="Job Illustration"
          style={{
            maxWidth: "80%",
            height: "auto",
            borderRadius: "10px",
            marginTop: "45px",
          }}
        />
      </div>
    </div>
  );
};

const styles = {
  jobList: {
    display: "flex",
    flexDirection: "column",
    marginLeft: "20px",
  },
  jobRow: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
    marginBottom: "20px",
  },
  jobItem: {
    border: "1px solid #ddd",
    backgroundColor: "rgba(246, 248, 213, 0.42)",
    borderRadius: "5px",
    padding: "20px",
    margin: "10px 0",
    width: "23%", // Adjusted to fit 4 items in a row
    textAlign: "left",
  },
};

export default JobList;
